import React from "react";

function Pagination({ intakesPerPage, totalIntakes, paginate }) {
  const pageNumbers = [];

  for (let i = 1; i <= Math.ceil(totalIntakes / intakesPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <nav>
      <ul className="pagination">
        {pageNumbers.map ((pageNumber) => (
          <li key={pageNumber}>
            <a onClick={() => paginate(pageNumber)} href="#">
              {pageNumber}
            </a>
          </li>
        ))}
      </ul>
    </nav>
  );
}

export default Pagination;
